import React, { Component } from "react";

class Counter extends Component {
  constructor(props) {
    super(props);

    this.state = {
      count: 5
    };
  }

  incrementCount = () => {

      this.setState({
        count: this.state.count++
      });

  };

  render() {
    return (
      <div className="counter">

        {this.state.count}

        {<button onclick = {this.incrementCount}>Click</button>}

      </div>
    );
  }
}

export default Counter;
